import React from 'react'
import toursCard from "../../shared/TourCards"
import { Col } from 'reactstrap'

const FeaturedTourList = () => {
  return (
    <>
        tourData?.map(tour => (
            <Col lg='3' className='mb-4' key={tour.id}>
                <toursCard tour={tour}/>
            </Col>
        ))
    </>
  )
}

export default FeaturedTourList
